import './Header.css';

function Header() {
    return (
        <div className='header'>
            <h1> This is the Header </h1>


            <div className='header__left'>
                <img src="" alt=""/>
                <div classNam='header__search'>

                </div>
            </div>
            
            <div className='header__right'>
                     
            </div>
        </div>
    )
}

export default Header;
